base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [9, "Sur une radiographie de thorax de face, quel est le signe qui n’est pas en faveur d’un œdème  aigu du poumon sur un rétrécissement mitral ?", "Dans le RM, il n’y a pas d’insuffisance ventriculaire gauche.", 1], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [10, "Les oedèmes aigus du poumon de type hémodynamique sont dus à une :", "L’OAP HEMODYNAMIQUE OU CARDIOGENIQUE est lié à une augmentation de la PCP au-delà de 30 mmHg. <br />Au début, on observe une extravasation du liquide plasmatique dans le secteur interstitiel entraînant un œdème interstitiel  puis un passage dans l’espace alvéolaire avec inondation de ce dernier. <br />La teneur en protides du liquide d’œdème est basse (<50% de la protidémie). <br />Bien entendu, la MAC reste intacte.", 1], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [11, "Dans les crises d’oedème aigu du poumon peu sévère, on retrouve à la gazométrie une :", "Dans l’OAP, la gazométrie retrouve : Une hypoxémie plus ou moins profonde. <br />Une hypocapnie avec alcalose respiratoire (secondaires à l’hyperventilation avec effet  shunt).<br />La saturation artérielle en O2 : elle demeure longtemps normale. <br />Sa baisse au dessous de 90% est un élément de mauvais pronostique qui impose une modalité ventilatoire plus efficace. <br />L’hypercapnie est rare et constitue un signe de gravité, elle est souvent concomitante à une poussée hypertensive.", 1], function() {progress()})
