base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [19, "Les signes cliniques pouvant être compatibles avec le diagnostic de thrombophlébite des membres inférieurs sont :", "Les signes cliniques sont à type de Signes locaux : Douleur à la palpation du mollet et surtout à la dorsiflextion du pied (signe de Homans). <br />Œdème ferme, prenant peu ou pas le godet, limité au mollet ou remontant à la cuisse. <br />Signes inflammatoires avec augmentation de la chaleur locale et dilatation veineuse superficielle. <br />Signes généraux : Fièvre- Pouls le « pouls grimpant de Mahler ».", 3], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [20, "Devant une suspicion clinique de thrombophlébite de la jambe, le(s) quel(s) de ces examens permet(tent) d’éliminer le diagnostic par sa (leur) normalité ?", "2 examens peuvent éliminer une thrombophlébite : Echo-doppler veineux et le Dosage des D-dimères : un test négatif permet d’exclure une TVP avec un risque d’erreur inférieure à 5% par le test ELISA.", 3], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [21, "Chez une femme enceinte de 8 mois, vous avez la certitude d’une thrombose veineuse fémorale sans embolie pulmonaire. Quelle thérapeutique préconisez-vous dans l’immédiat ?", "Il faut instaurer un traitement anticoagulant à type d’héparinothérapie ou d’héparines de bas poids moléculaire (HBPM).", 3], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [22, "A quelle(s) exigence(s) doit répondre un traitement anticoagulant curatif par l’héparine lorsqu’il est prescrit pour traiter une thrombose veineuse profonde ?", "L’héparinothérapie initialisée par un bolus intraveineux d’héparine (100 UI/Kg/j) suivie par un traitement intraveineux soit continu au pousse seringue, soit en discontinue toutes les 4 heures ou alors par de la calciparine en sous-cutanée toutes les 8 heures avec une posologie adaptée au poids du patient (500 UI/Kg/j) puis en fonction du temps de Céphaline activée. <br />Quelque soit le mode d’administration du traitement héparinique.<br />L’important étant d’obtenir le plus rapidement possible une efficacité biologique. <br />La posologie est adaptée selon le TCA (2 à 3 fois le témoin pour une hypocoagulabilité efficace).", 3], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [23, "Le traitement par les héparines à bas poids moléculaire est surveillé par :", "Les héparines de bas poids moléculaire (HBPM) en une ou deux injections quotidiennes sont actuellement devenues le traitement de référence des TVP. <br />La dose est simplement adaptée ou poids et ne nécessite ensuite plus de contrôle selon l’activité anti-Xa, dont la surveillance n’augmente ni l’efficacité ni la sécurité. <br />Les HBPM présentent également un risque inférieur de survenue de TIH, mais le contrôle bihebdomadaire de la numération des plaquettes durant le traitement demeure la règle. <br />La facilité d’utilisation des HBPM permet d’envisager un traitement ambulatoire de TVP, ou une hospitalisation très réduite de 48 heures.", 3], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [24, "Au cours d’un relais héparine Sintrom* (Acénocoumarol) vous obtenez les résultats suivants : temps de céphaline kaolin = 1,5/témoin ; taux de prothrombine 26%.<br />Choisissez, en fonction de ces résultats, l’attitude convenable :<br />", "Il faut un INR.", 3], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [25, "Cocher les propositions vraies concernant les phlébites de membres inférieurs :", "A:  La spécificité des d-dimères est mauvaise car une élévation des D-dimères est aussi retrouvée lors de l’inflammation, de cancer, de traumatisme, de grossesse, de période post-opératoire, d’âge avancé. <br />B: Pas toujours heureusement.<br />C: Signe de Homans : Douleur à la palpation du mollet et surtout à la dorsiflextion du pied (présente dans 60% des cas).<br />", 3], function() {progress()})
