base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [32, "Chez un patient de 18 ans présentant une oppression thoracique nocturne, avec une spirométrie normale en dehors des crises, l’examen complémentaire indiqué dans le cadre du diagnostic positif de la maladie asthmatique dans ce cas est :", "Test de provocation non spécifique (Inhalation de Carbacol suivie de mesure de VEMS ou autre débit. <br />Toute baisse de VEMS atteignant les 20% fait arrêter d’abord le test et permet de déterminer la dose inhalée appelée dose liminaire celle-ci est d’autant plus basse que le sujet est hyper-réactif.", 4], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [33, "Dans une crise d’asthme, l’exploration fonctionnelle respiratoire montre une diminution :", "Elle a un triple intérêt : diagnostic, pronostic et thérapeutique.<br />L’EFR est rarement pratiquée au moment des crises, on lui préfère le DEP.<br />Lorsqu’elle est réalisée elle montre un syndrome obstructif avec une diminution du VEMS, diminution des débits à différents points de la capacité vitale (DEM, débits expiratoires à 50% et 75% de la CV).<br />", 4], function() {progress()})
