base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [38, "Le transsudat pleural : (indiquer La ou les réponses exactes)", "Transsudation plasmatique due habituellement à une augmentation de la pression hydrostatique dans la petite circulation, entraînant une œdème interstitiel, plus rarement le transsudat est dû à une diminution de la pression oncotique (au cours du S.N).<br />Protides < 30g/l, LDH < 200UI/l, densité < 1014, cellules rondes.<br />", 5], function() {progress()})
