base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [40, "La cause la plus fréquente de pneumothorax spontané est :", "Deux grands mécanismes parfois associés :<br />-	Pneumothorax mécanique du à la rupture de bulles ou blebs.<br />-	Dystrophie localisée « malformative ou acquise »<br />Malformative : blebs = anomalie constitutionnelle du tissus élastique de soutien<br />Acquise : très petites bulles secondaires à des pédiculités septiques.<br />", 5], function() {progress()})
