base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [99, "Une hépatomégalie douloureuse et fébrile peut être observée dans les circonstances suivantes sauf une, laquelle ?", "Elle est la cause la plus fréquente des hépatomégalies. <br />Elle est observée le plus souvent chez  l’alcoolique, le diabétique, le sujet obèse et lors de la dénutrition. <br />Il s’agit d’une hépatomégalie de consistance molle avec bord inférieur mousse, surface régulière homogène, et sensible. <br />On a également une augmentation concomitante des gamma GT, transaminase, et phosphatase alcaline. <br />L’échographie abdominale montrera un fois brillant hyperéchogéne homogène.", 11], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [100, "Parmi les propositions suivantes, certaines orientent vers l’étiologie néoplasique d’une hépatomégalie. Lesquelles ?", "Sur le plan clinique, il se développe à 90% des cas sur cirrhose pré-existante. <br />Il se manifeste par une hépatomégalie volumineuse, de consistance dure pierreuse, de surface hétérogène, sensible, peu mobile à la respiration. <br />Les signes d’accompagnement sont la fièvre, l’altération de l’état général, l’ictère, l’hépatalgie, l’ascite hémorragique, et à certain degré une hypertension portale et une insuffisance hépatocellulaire.", 11], function() {progress()})
