base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [102, "Une hépatomégalie chez un patient ictérique peut se voir dans :", "La maladie de Gilbert ne s’accompagne que de l’ictère mais pas d’hépatomégalie ; l’insuffisance cardiaque droite est généralement accompagné d’hépatomégalie douloureuse, mais sans ictère.", 11], function() {progress()})
