base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [106, "Une hépatomégalie douloureuse est habituellement présente au cours de :", "Cependant les cirrhoses décompensées surtout par l’infection, s’accompagnent de fièvre.", 11], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [107, "Devant une hépatomégalie, le premier examen complémentaire à demander est :", "C’est l’examen primordial, de première nécessité. <br />Il permet la mensuration du foie d’une façon précise, il peut montrer une hépatomégalie homogène ou une hépatomégalie tumorale.", 11], function() {progress()})
