base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [110, "Une splénomégalie volumineuse peut se voir dans :", "Drépanocytose et déficit en G6PD comporte certes dans leurs tableau une SPM mais non volumineuse ; après une certaine évolution de la drépanocytose, on y observe plutôt une atrophie splénique par infarctus spléniques répétés.", 12], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [111, "Un malade de 30 ans consulte pour volumineuse splénomégalie. <br />L’hémogramme montre une hyperleucocytose à 350 000 par mm3 avec myélémie, sans anémie. <br />Le taux des plaquettes est à 550000 par mm3. <br />La vitesse de sédimentation est à 5 à la 1 heure. <br />Quel est votre diagnostic ?", "LMC au stade chronique sans traitement. La plénomégalie : c’est le signe fondamental et souvent le seul signe de la maladie. <br />Elle est généralement présente et le plus souvent volumineuse dépassant l’ombilic.<br />Les globules blancs : hyperleucocytose importante le plus souvent supérieur à 100000/mm³ à PNN (30 à 40%) Myélémie importante dans les mêmes proportions que dans la moelle osseuse : Métamyélocyte (10 à 50%) > Mycélocyte > Promyélocyte > myéloblaste (< 5%) Globules rouges : normaux ou légére anémie normochrome carmocytaire arégénérative. <br />Les plaquettes : taux normal ou augmenté.", 12], function() {progress()})
