base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [114, "L’association d’une splénomégalie et dune myélémie doit faire discuter :", "Evident.", 12], function() {progress()})
base.query('insert into questions(id, question, revision, objective_id) values(?, ?, ?, ?)', [115, "L'association d'une pancytopénie sévère et d'une splénomégalie peut correspondre à l'un des diagnostics suivants, lequel ?", "Le syndrome tumoral de la LA est inconstant : Des douleurs osseuses (avec des images d’ostéolyse en bandes claires métaphysaires et apposition périostée à la radiographie.).(dans les LAL+++ et LAM+) et une hypertrophie de la rate, du foie, des ganglions et adénopathies médiastinales (LAL+++ LAM+) . <br />A la NFS : Une anémie normochrome normocytaire ou macrocytaire arégénérative. <br />Une thrombopénie avec ou sans blastes ( les blastes sont présents dans 90% des cas).", 12], function() {progress()})
